DROP TABLE IF EXISTS `characters`;
CREATE TABLE `characters` (
  `guid` int(10) unsigned zerofill NOT NULL AUTO_INCREMENT,
  `account` int(10) unsigned zerofill NOT NULL,
  `name` varchar(60) COLLATE utf8_bin NOT NULL,
  `sex` tinyint(4) NOT NULL,
  `type` tinyint(4) NOT NULL,
  `head` int(10) unsigned zerofill NOT NULL,
  `city` int(10) unsigned zerofill NOT NULL,
  `mapid` int(10) unsigned zerofill NOT NULL,
  `posx` float(11,0) NOT NULL,
  `posy` float(11,0) NOT NULL,
  `dir` float(11,0) NOT NULL,
  `createtime` datetime NOT NULL,
  `flag` int(10) unsigned zerofill NOT NULL,
  `data` varbinary(2000) DEFAULT NULL,
  `del` int(10) unsigned zerofill NOT NULL,
  PRIMARY KEY (`guid`),
  UNIQUE KEY `name` (`name`) USING BTREE,
  KEY `account` (`account`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8001 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

