DROP PROCEDURE IF EXISTS `addTestChar`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `addTestChar`()
BEGIN
	#Routine body goes here...
	DECLARE Enable_test TINYINT DEFAULT 1;
	DECLARE i INT DEFAULT 2401;
	DECLARE s VARCHAR(255) DEFAULT '4';
	DECLARE mail VARCHAR(255) DEFAULT 'aa@furen.com';
	
	IF Enable_test = 1 THEN
		loopl: WHILE i <= 8000 DO
			SET s = i;
			SET mail = CONCAT('test',s);
			SET i = ABS(i) + 1;
		END WHILE loopl;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `CreatePlayer`
-- ----------------------------
DROP PROCEDURE IF EXISTS `CreatePlayer`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `CreatePlayer`(IN `char_name` varchar(100),IN `char_head` int,IN `char_sex` int,IN `char_type` int,IN `char_account` int,IN `char_map` int,IN `char_city` int)
BEGIN
	#Routine body goes here...
	DECLARE player INT DEFAULT 0 ;
	DECLARE error_code INT DEFAULT 0;
	SELECT `guid` INTO player FROM `characters` WHERE `account` = char_account AND `del` = 0;
	IF player = 0 THEN
		SELECT `guid` INTO player FROM `characters` WHERE `name` = char_name;

		IF player = 0  THEN
			SET error_code = 0;
			SELECT error_code;
			SELECT * FROM `characters` WHERE `account` = char_account AND `del` = 0;
				
		ELSE
			SET error_code = 2;
			SELECT error_code;
		END IF;
	
	ELSE
		SET error_code = 1;
		SELECT error_code;
	END IF;
END
;;
DELIMITER ;

