-- ----------------------------
-- Procedure structure for `QueryRelation`
-- ----------------------------
DROP PROCEDURE IF EXISTS `QueryRelation`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `QueryRelation`(IN `player` int)
BEGIN
	#Routine body goes here...
	#
	#SELECT RR.`player_a`,RR.`player_b`,RR.`relation`, RR.`mark_a`,RR.`mark_b`, RR.`group_a`, RR.`group_b`, `characters`.`name`,`characters`.`sex`, `characters`.`type` FROM
	#(SELECT * FROM `character_relation` WHERE `player_a` = player OR `player_b` = player) AS RR INNER JOIN `characters`
	#ON ((RR.`player_a` = player AND RR.`player_b` = `characters`.`guid`) OR (RR.`player_b` = player AND RR.`player_a` = `characters`.`guid`));

	SELECT RR.`player`,RR.`relation`, RR.`mark`, RR.`group`, `characters`.`name`,`characters`.`sex`, `characters`.`type` FROM
	(SELECT * FROM `character_relation` WHERE `ower` = player) AS RR INNER JOIN `characters` ON ( `characters`.`guid`= RR.`player` AND `characters`.`del` =  0);

	#
	SELECT RR.`proposer`, RR.`relations`,`characters`.`name`,`characters`.`nex`,`characters`.`type` FROM
	(SELECT * FROM `character_proposer` WHERE `accepter` = player) AS RR INNER JOIN `characters` ON  (RR.`proposer` = `characters`.`guid` AND `characters`.`del` =  0);
END
;;
DELIMITER ;

