DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `test_Rand`()
BEGIN
	#Routine body goes here...
	#DECLARE guid_max BIGINT DEFAULT 0 ;
	#SELECT Max(`guid`) INTO guid_max FROM characters;
	UPDATE characters SET city = FLOOR(1+RAND() * 3), mapid = FLOOR(1+RAND() * 3), posx = FLOOR(RAND() * 200),posy = FLOOR(RAND() * 200);
	
END
;;
